//import React, { useState, useEffect } from 'react';

function Search(props) {
  const { onFilterChange } = props;

  const [filters, setFilters] = useState([{ type: 'name', query: '' }]);

  // Update the filter state when the input value changes
  const handleInputChange = (event, index) => {
    const newFilters = [...filters];
    newFilters[index].query = event.target.value;
    setFilters(newFilters);
  };

  // Add a new filter to the state
  const addFilter = () => {
    setFilters([...filters, { type: 'name', query: '' }]);
  };

  // Remove a filter from the state
  const removeFilter = (index) => {
    const newFilters = [...filters];
    newFilters.splice(index, 1);
    setFilters(newFilters);
  };

  // Apply the filters when the search button is clicked
  const handleSearch = () => {
    onFilterChange(filters);
  };

  // Reset the filters when the reset button is clicked
  const handleReset = () => {
    setFilters([{ type: 'name', query: '' }]);
    onFilterChange([]);
  };

  return (
    <div className='search-container'>
      {filters.map((filter, index) => (
        <div key={index} className='search-row'>
          <select
            value={filter.type}
            onChange={(event) => {
              const newFilters = [...filters];
              newFilters[index].type = event.target.value;
              setFilters(newFilters);
            }}
          >
            <option value='name'>Name</option>
            <option value='pressure'>Pressure</option>
            <option value='serialnum'>Serial Number</option>
            <option value='date'>Date</option>
            <option value='jobnum'>Job Number</option>
          </select>
          <input
            type='text'
            value={filter.query}
            onChange={(event) => handleInputChange(event, index)}
          />
          {index > 0 && (
            <button type='button' onClick={() => removeFilter(index)}>
              X
            </button>
          )}
        </div>
      ))}
      <div className='search-row'>
        <button type='button' onClick={addFilter}>
          Add Filter
        </button>
        <button type='button' onClick={handleSearch}>
          Search
        </button>
        <button type='button' onClick={handleReset}>
          Reset
        </button>
      </div>
    </div>
  );
}

export default Search;
